script: |
  super -f text -I q10816.spq | sort > q10816.out

inputs:
  - name: q10816.spq
    data: |
      SELECT + - COUNT ( * ) + + - 9 + + COUNT ( * ) AS col1, COUNT ( * ) * - 3 + + 6 AS col0 FROM tab2 (FORMAT parquet) AS cor0;
  - name: tab2

outputs:
  - name: q10816.out
    data: |
      -9	-3
